import React from 'react';

import './Main.css';

export default function Main({cityCOL1, cityCOL2, cityName1, cityName2, salary1, salary2}) {
    const calcAdjustedSal = (salary, col) => {
        console.log(salary);
        return salary * (col/100);
    }

    const betterJob = (salary1, salary2) => {
        return salary1 > salary2 ? "1" : "2";
    }

    const worseJob = (salary1, salary2) => {
        return salary1 < salary2 ? "1" : "2";
    }

    const adjSalary1 = calcAdjustedSal(salary1, cityCOL1);

    return (
        <div className='main'>
            <div className='section1'>
                <p className='section1-text'>
                    Job #{betterJob(salary1, salary2)} more than Job #{worseJob(salary1, salary2)} by ${calcAdjustedSal(salary1, cityCOL1) - calcAdjustedSal(salary2, cityCOL2)}
                </p>
            </div>
        </div>
    );
}
